import './App.css';
import JournalContainer from './containers/JournalContainer';
import NavBar from '../components/NavBar';

function App() {
  return (
    <div className="App">
      <Navbar />
      <h1>Daily Journal App</h1>
      <JournalContainer />
    </div>
  );
}

export default App;
